import { useState, useEffect } from "react";
function Process({ socket }) {
  const [userlist, setUserList] = useState([]);
  useEffect(() => {
    socket.on("userList", (data) => {
      console.log(data);
      let temp = data;
      setUserList(temp);
    });
  }, [socket]);
  return (
    <div className="chat-message">
      {userlist.map((i) => {
          return(
            <div>
              <p>hello</p>
            </div>
          );
      })}
    </div>
  );
}
export default Process;
